;; Example: {'action': 'PutObject', 'args': ['handtowel', 'tub']}
(:action PutObject
    :parameters (?a - agent ?l - location ?o - object ?r - receptacle ?ot - otype ?rt - rtype)
    :precondition (and
            (holds ?a ?o)
            (atLocation ?a ?l)
            (receptacleAtLocation ?r ?l)
            (or (not (openable ?r)) (opened ?r))    

            (objectType ?o ?ot)
            (receptacleType ?r ?rt)
            (canContain ?rt ?ot)

            )
    :effect (and
                (inReceptacle ?o ?r)
                (objectAtLocation ?o ?l)

                (not (holds ?a ?o))
                (not (holdsAny ?a))
                (increase (total-cost) 1)
            )
 )

